window.bookSummaryJSON = "<p><b>Having ascended to the prestigious role of High Priestess of Philosophia Naturalis, Kadia Greene faces challenges that push her to her limits.</b></p> <p>Tasked with restoring ancient teachings and gathering followers, she embarks on a perilous journey with her friends. As they traverse dangerous terrains and navigate political intrigue, cities are forsaken, mountains are set ablaze, and temples are constructed on secluded peaks.</p> <p>Yet, amid her feats, Kadia grapples with a deteriorating mental state, often losing track of time, reality, and even her own identity. As her internal struggle intensifies, she must balance preserving her sanity with her responsibilities to her disciples, her guild, and ultimately, herself.</p>"; 
